  summary: "Egy figyelő, amely az összes nyomkövetéséhez és a kimeneti biztosít a [!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)] infrastruktúra."
  remarks: "A IisTraceListener osztály csatlakozik a nyomkövetés mechanizmusát [!INCLUDE[vstecasp](~/add/includes/vstecasp-md.md)] való [!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)]. Ez az osztály a figyelő lehetővé teszi, hogy a létrehozó fejlesztőknek [!INCLUDE[vstecasp](~/add/includes/vstecasp-md.md)] alkalmazásokat, és akik valósítja meg a <xref:System.Web.IHttpModule>és <xref:System.Web.IHttpHandler>felületet a lapszintű, modul szintű vagy kezelő szintű az események a [!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)] infrastruktúra nyomon követésekor engedélyezve van.</xref:System.Web.IHttpHandler> </xref:System.Web.IHttpModule>      > [!NOTE] > Nem irányítja a figyelő osztály [!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)] események ASP.NET osztályokra. Ez magában foglalja a <xref:System.Web.UI.Page>osztály és osztályokat, amelyek megvalósítják a <xref:System.Web.IHttpModule>vagy <xref:System.Web.IHttpHandler>felületet.</xref:System.Web.IHttpHandler> </xref:System.Web.IHttpModule> </xref:System.Web.UI.Page>       IisTraceListener bevezetett a [!INCLUDE[net_v35_long](~/add/includes/ajax-current-ext-md.md)]. További információkért lásd: [verziója és a függőségek](~/add/includes/ajax-current-ext-md.md)."
